import { makeStyles, createStyles } from "@material-ui/styles";

const useStyles = makeStyles((theme) => createStyles({
  root: {
    position: "relative",
    height: "100%",
    backgroundColor: "red"
  },
  tabs: {
    position: "absolute",
    width: "100%",
    bottom: 0,
  },
  flex: {
    height: "100%"
  },
  label: {
    fontSize: 25
  },
  parent: {
    backgroundColor: "#A50034",
    shadow: "inset 0 -0.1em 0.1em rgba(0, 0, 0, 0.25), inset 0 0.2em 0.2em rgba(0, 0, 0, 0.25)"
  }

}));

export default useStyles;
